import React, { useState } from 'react';
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/InputGroup';
import Button from 'react-bootstrap/Button';
import SearchOutlinedIcon from '@mui/icons-material/SearchOutlined';

function SearchBar(props) {
  // const [query, setQuery] = useState('');
  const {query, setQuery} = props;
  return (
    <div style={{width:"100%", }}>
      <div className="search-bar d-none d-md-flex justify-content-center">
        <input
          className="border input1 border-secondary p-3"
          type="text"
          placeholder="5 unale st, ikeja nigeria"
        />
      </div>
      <div className="d-md-none search-bar  d-flex justify-content-center">
        <input
          className="border input2 border-secondary p-3"
          type="text"
          onChange={(e)=>setQuery(e.target.value)}
          placeholder="5 unale st, ikeja nigeria"
        />
      </div>
    </div>
  );
}

export default SearchBar;
